    type: "text",
    markdown: `There has been growing engagement with civic digital literacy and university internship schemes, which are often framed in terms of information literacy skills development. SunoikisisDC, an international group focused on Digital Classics programmes, has been engaged with Wikimedia UK and our partners the Women’s Classical Committee. There have been further iterations of the Wikidata Map of Accused Witches project, now recognised within the global Wikimedia community and driving recognition of the power of Wikidata in heritage engagement.

We continue to seek funding for digital literacy work in schools across England. Our Wales programme has had continued success across our partnership with Menter Môn, focused on subjects such as digital licensing, collaborative working, data evaluation and editing. Year 12 students at Ysgol Syr Thomas Jones, Ysgol Llangefni and Ysgol Uwchradd Bodedern have been creating and enriching articles, adding the meaning and historical context of the island’s Welsh place names on the Welsh Wiki.`
