    markdown: `3% of our events and activities in 2022-23 were focused on Climate and Environment. We look to rapidly increase this focus, with the launching of our partnership in October 2022 with the Global Systems Institute and our first Wikimedian in Residence for Climate. As with COP26, we engaged with COP27 in 2022 as an opportunity to highlight our focus and the climate intersection with heritage and threatened heritage.
    
Our first Residency editathon was delivered in January 2023, so we are in the infancy of this strategic work. Articles edited were as diverse as The Great Barrier Reef, Food loss and Waste, Energy Security, and Rice. Partnerships are being developed across relevant institutions and academics, with Climate Visuals and Carbon Brief already engaged and adding images to Wikimedia Commons.`
