        imgUrl: "https://firebasestorage.googleapis.com/v0/b/wmsr2023-4b6d6.appspot.com/o/round1images%2Fwmsr2023_aim3_accordion_puffin_hover-5b13067d-3809-408c-baa6-52e380954fc9.webp?alt=media",
        heading: "Crowdsourcing images in Wales to track environmental changes",
        markdown: `### Wales moves up to second place in Wiki Loves Earth
**By Robin Owain, Programme Manager for Wales at Wikimedia UK**
        
![Morning Sun at Three Cliffs Bay, Gower](https://firebasestorage.googleapis.com/v0/b/wmsr2023-4b6d6.appspot.com/o/round1images%2Fwmsr2023_aim3_image_bay-5562363e-f8dc-49e9-acb8-9e7f3bc310b3.webp?alt=media)

[Morning Sun at Three Cliffs Bay, Gower](https://commons.wikimedia.org/wiki/File:Morning_Sun_at_Three_Cliffs_Bay,_Gower.jpg#/media/File:Morning_Sun_at_Three_Cliffs_Bay,_Gower.jpg) by Mjw999. CC BY-SA 4.0

During [Wiki Loves Earth](https://commons.wikimedia.org/wiki/Commons:Wiki_Loves_Earth_2022_in_Wales) (WLE) 2022, editors from all over Wales went out into protected areas such as Sites of Special Scientific Interest (SSSIs), National Parks, and Areas of Outstanding Natural Beauty (AONBs), with cameras clicking in all directions!

Last year’s count of 1,892 photos now look meagre compared with 2022’s massive 5,041 images! The 10 best images will now go through to the final, but as far as numbers are concerned, [Wales came second out of 36 nations](https://wikiloves.toolforge.org/earth/2022), with Germany first, Brazil third, Kazakhstan fourth, and Russia fifth. Small is beautiful!

To many photographers, taking an aesthetically pleasing image that is technically correct and visually stunning is important. To me, as one of the editors (in my own time, of course), it’s equally important that we have lots of images that illustrate Wikipedia articles and document all aspects of our natural environment. Quality and quantity!

For the second year running, the National Library of Wales, Menter Môn and Wikimedia UK organised the competition. Within weeks, we had new partners, including the Welsh Government, all three National Parks: Eryri (Snowdonia), Pembrokeshire and the Brecon Beacons, as well as the Ramblers. Other existing partners included Natural Resources Wales and Llên Natur, the largest Welsh-language nature society.

> The National Library of Wales is thrilled to be able to work with Wikimedia UK to support this fantastic competition for the second year in a row. Once again the standard of photography and the number of entries has been exceptional. It is so important to capture and record the ever-changing beauty of our natural environment and to make that content freely available to all.

<p class="attribution">The National Library’s Open Data Manager, <strong>Jason Evans</strong></p>

WLE 2022 was a quick snapshot of the rich diversity of one small corner of our global biosphere: a record of flora, fauna and fungi as they were in the summer of 2022. Future snapshots could be used to show the differences in the biosphere and the impact of climate change. If Wikipedia could better illustrate this change, we could help negate the effect. So let’s get these images on Wikipedia articles, and make a difference!

**The winning image in Wales** is by User:Mjw999, featured above. It shows Three Cliffs Bay, within the Gower Area of Outstanding Natural Beauty in South Wales. Judges Iestyn Hughes and Simon Evans, both prominent local photographers, felt that the image captured the diversity of this beautiful landscape, which includes freshwater streams, a salt marsh and towering limestone cliffs.

In **second place** this year is User:Naff14, with a well-executed shot of a puffin on Skomer Island, collecting flowers for his nest building.

![Skomer island nest building by Naff14](https://firebasestorage.googleapis.com/v0/b/wmsr2023-4b6d6.appspot.com/o/round1images%2Fwmsr2023_aim3_image_puffin-c6ffecff-3948-4a28-8c30-e9de09afea73.webp?alt=media)

[Skomer island nest building](https://commons.wikimedia.org/wiki/File:Skomer_island_nest_building.jpg) by Naff14. CC BY-S.A 4.0.

And in **third place**, the judges agreed on a more abstract image of a rock on Rhossili Beach on the Gower by User:Suntooth. The judges felt that the image evoked the power of the wind and sea, while the patterns in the sand echoed the branches of trees.

![Rock on the beach by Suntooth](https://firebasestorage.googleapis.com/v0/b/wmsr2023-4b6d6.appspot.com/o/round1images%2Fwmsr2023_aim3_image_rock-bc6f67e1-27f7-4753-8aa1-10e4a4f698f3.webp?alt=media)

[Rock on the beach](https://commons.wikimedia.org/wiki/File:Rock_on_the_beach.jpg) by Suntooth. CC BY-S.A 4.0.

Also **highly commended** was the following image of footprints in the sand dunes at Gronant by User:ClwydRuth. The judges were keen to include this image as a way of raising the profile of the important but little-known habitats of Gronant Dunes.

![Walking in the Gronant Dunes by ClwydRuth](https://firebasestorage.googleapis.com/v0/b/wmsr2023-4b6d6.appspot.com/o/round1images%2Fwmsr2023_aim3_image_dune-3f62eea9-15ef-4e00-adb7-16e2022bfa34.webp?alt=media)

[Walking in the Gronant Dunes](https://commons.wikimedia.org/wiki/File:Walking_in_the_Gronant_Dunes.jpg) by ClwydRuth. CC BY-S.A 4.0.

**The ten best Wales images can be seen [here](https://commons.wikimedia.org/wiki/Category:WLE2022CY_Winners), and the global winners can be found [here](https://commons.wikimedia.org/wiki/Commons:Wiki_Loves_Earth_2022/Winners).**

_Image: Puffins courting on Skomer Island by Naff14. [Details](https://commons.wikimedia.org/wiki/File:Puffin_love.jpg)_`
