    type: "text",
    markdown: `Public profile and recognition can be measured in a number of ways. We worked across 56 strategic partnerships in 2022-23, our social media following increased, and we reached 50,000 people.
Organisational resilience is supported by our Board, chaired by Monisha Shah; members bring their skills to support our governance, strategic direction and sustainability. In 2022, the Wikimedia Summit Berlin was attended by Wikimedia UK trustee Caroline Ball, who shared her thoughts in Rebecca O’Neill’s ‘World According to Wikipedia’ podcast:

<iframe style="border-radius:12px" src="https://open.spotify.com/embed/episode/6lktDD3h4R7rReVB6czAa9?utm_source=generator&theme=0" width="100%" height="152" frameBorder="0" allowfullscreen="" allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture" loading="lazy"></iframe>

With contributions from trustees, senior staff and invited experts, we hold regular reviews to focus on the pillars’ performance, risks and opportunities in our Audit and Risk Committee, Governance Committee, and the newly formed Community Development Committee.

Looking at the next stages of our organisation development, we have recently restructured our Programmes and Evaluation team to support further expansion for new projects. Additional investment for 2023-24 was signed off by the Board to deliver a new Customer Relationship Management (CRM) tool, allowing streamlining and automation of current processes and further opportunities to develop our connections and relationships with donors and volunteers.
`
